import React, { Component } from "react";
import { Nav } from "react-bootstrap";
import "../../style/Dashboard.css";

export default class StudentNavMenuElement extends Component {
  render() {
    return (
      <Nav.Item eventKey={this.props.componentName} className="sm-element">
        <div className="sm-cont-icon">
          <i
            className={"sm-icon fa " + this.props.componentIcon}
            aria-hidden="true"
          ></i>
        </div>
        <div className="sm-element-name">{this.props.componentName}</div>
      </Nav.Item>
    );
  }
}
